=head1 DESCRIPTION

Use Job engine versions to run jobs for your production workflow on one
version, while you test and validate the latest version. Job engine
versions are in a YYYY-MM-DD format.

=head1 ATTRIBUTES


=head2 ExpirationDate => Str

The date that this Job engine version expires. Requests to create jobs
with an expired version result in a regular job, as if no specific Job
engine version was requested.


